export default ( state = false, action ) =>{
    if(action.type === 'ME_PINCHO_CARNAL'){
        if(action.payload === false){
            return({
                ...state,
                sw : true
            })
        }else if(action.payload === true){
            return({
                ...state,
                sw: false
            })
        }
    }

    return state

}

const fexportada = (state) => state.pinchoReducer.sw
